import React from 'react';

import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';

// MATERIAL UI ICONS
import SupervisedUserCircleIcon from '@mui/icons-material/SupervisedUserCircle';

function WhoAreWe() {
  return (
    <Paper
      id="who-are-we"
      sx={{
        width: '70%',
        maxWidth: '800px',
        margin: '0 auto',
        position: 'relative',
        top: '-4rem',
        padding: '2rem',
      }}
    >
      <Box sx={{ textAlign: 'center' }}>
        <SupervisedUserCircleIcon color="primary" fontSize="large" />
      </Box>
      <Box mb={2}>
        <Typography align="center" variant="h4"> Qu&apos;est-ce que Roundnet France Ranking ? </Typography>
        <Typography variant="subtitle1" align="center">La référence officielle du roundnet en France</Typography>
      </Box>
      <Divider variant="middle" />

    </Paper>
  );
}

export default WhoAreWe;
